import React from 'react';
import './css/Navbar.css';
import Logo from '../images/logo.png';


function Nav() {
  return (
    <div>
        <div className='navbar'>
          <a href="/"><img className='logo' src={Logo} alt='logo'/></a>
        
           <ul>
            <a href="/"><li >
              <button>Log in</button>
              </li></a>
            <a href="/"><li>
              <button>Sign in</button>
              </li></a>
            <a href="/resturant"><li>Resturant</li></a>
            <a href="/Kids"><li>Kids</li></a>
            <a href="/tech"><li>Tech</li></a>
            <a href="/res"><li>Food</li></a>
            <a href="/"><li>Home</li></a>
              <form >
                <input type='text' className='search' placeholder='                          search                &#x1F50D;' /> 
                <input type="submit" value="Search" id='search' className='form-text'/>
              </form>
            </ul> 
            
            
            
        </div>
        
        
    </div>
  );
}

export default Nav;
